import './Style.css';
import Footer from '../Footer';

export default function String() {
    return (
        <div> 
        <div className='style-container'>
             <div className='style-img'>
                 <img src='/images/sita.JPG' />
            </div>

            <div className='style-con'>
                <p className='style-heading'>Summary</p>
                 <p className='style-body'> This is a speech therapy app <a className='style-link' href='https://github.com/harleenc16/String-Matching-algorithm'>here </a>. 

                 </p>



          </div>  
         </div> 
         <Footer /> 
  </div>
    )
}
